import React from 'react';
import {Link} from "react-router-dom"
import {NavLink} from "react-router-dom"
import "./Navbar.css";

const Navbar = () => {
    return (
        <nav>
            <Link to='/' className="title">Call App</Link>
            
            <ul>
                <li>
                    Pricing
                </li>
                <li>
                    Contact
                </li>
                <li>
                    Sign In
                </li>
            </ul>
        </nav>
    );
};

export default Navbar;
